import React from "react";
import { createBrowserRouter, Navigate } from "react-router-dom";
import App from "./App";
import Authentication from "./pages/Authentication";
import ErrorPage from "./pages/ErrorPage";
import About from "./pages/About";
import ProtectedRoute from "./ProtectedRoute";
import AnalyticsPage from "./pages/AnalyticsPage";

// Create router configuration
const router = createBrowserRouter([
  {
    path: "/",
    element: <Navigate to="/authentication" replace />, // Redirect root to /authentication
  },
  {
    path: "/authentication",
    element: <App />, // Main layout component
    errorElement: <ErrorPage />,
    children: [
      {
        index: true, // Renders at "/authentication" by default
        element: <Authentication />,
      },
      {
        path: "/login", // Renders at "/authentication/login"
        element: <Authentication />,
      },
      {
        path: "/signup", // Renders at "/authentication/signup"
        element: <Authentication />,
      },
      {
        path: "/about", // Renders at "/authentication/about"
        element: <About />,
      },
      {
        path: "/analytics", // Renders at "/authentication/analytics"
        element: <ProtectedRoute element={<AnalyticsPage />} />, // Protected route
      },
    ],
  },
  {
    path: "*", // Catch-all for unmatched routes
    element: <ErrorPage />,
  },
]);

export default router;
